  false,\n\t\"url\": null,\n\t\"notes\": \"This data set shows Greenhouse Gas Reduction
  Projects funded under California's Cap and Trade Program's Greenhouse Gas Reduction
  Fund (GGRF). These projects include mountain meadow and Sacramento-San Joaquin Delta
  wetland restoration projects that will lead to reductions in greenhouse gases. It
  was created by the California Department of Fish and Wildlife Watershed Restoration
  Grants Branch in August of 2015. Although only 12 projects were funded, many of
  the projects covered multiple sites. Each site location is shown in this data set.\",\n\t\"license_title\":
